import React from 'react'
import { AbstractCarColor, AbstractDoor, AbstractEngine, AbstractLight, AbstractRims, AbstractTire, AbstractWindow } from './AbstractCar.types'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCar, faDoorOpen, faPersonThroughWindow, faCircle, faBraille, faFaceDizzy, faArrowLeft } from '@fortawesome/free-solid-svg-icons'
import {Link} from 'react-router-dom'

type AbstractCarProps = {
    engine: AbstractEngine[],
    doors: AbstractDoor[],
    windows: AbstractWindow[],
    tires: AbstractTire[],
    rims: AbstractRims[],
    color: AbstractCarColor[]
}
const NormalCar = (props: AbstractCarProps) => {
    return (
        <div>
            <div className='header'>
                <h1>Stel je Auto samen:</h1>
            </div>
            <div className='sub-header'>
            <h2><Link className='back' to="/"><FontAwesomeIcon icon={faArrowLeft} /> Terug<br></br></Link>Klik op de eigenschappen om ze te kiezen</h2>
            </div>
            <div className='option-container'>
                        <h2><FontAwesomeIcon icon={faCar} />  Moter:<br></br> </h2>
            {
                props.engine.map(car => {
                    return (
                        <div>
                        <h3 key={car.id}> {car.EngineType}</h3>
                        </div>
                    )
                })
            }
             </div>
             <div className='option-container'>
                                <h2><FontAwesomeIcon icon={faDoorOpen} /> Kleur deuren:<br></br> </h2>
            {
                props.doors.map(door => {
                    return (
                        <div>

                        <h3 key={door.id}>{door.color}</h3>
                        </div>

                    )
                })
            }
            </div>
            <div className='option-container'>
                        <h2><FontAwesomeIcon icon={faPersonThroughWindow} />  Kleur ramen:</h2>

            {
                props.windows.map(window => {
                    return (
                        <div>
                        <h3 key={window.id}>{window.color}</h3>
                        </div>
                    )
                })
            }
            </div>
            <div className='option-container'>
                        <h2><FontAwesomeIcon icon={faCircle} />  Kleur banden:</h2>
                 {
                props.tires.map(tire => {
                    return (
                        <div>
                        <div>
                        <h3 key={tire.id}>{tire.color}</h3>
                        </div>
                        </div>
                    )
                })
            }
              </div>
            {
                props.rims.map(rim => {
                    return (
                        <div>
                        <div className='option-container'>
                        <h2><FontAwesomeIcon icon={faFaceDizzy} />  Velg kleur:</h2>
                        <h3 key={rim.id}>  {rim.color}</h3>
                        </div>
                        </div>
                    )
                })
            }
            </div>
    )
}

export default NormalCar
